import React from "react";
import { useParams } from "react-router-dom";
import Skardu from "../components/Skardu";
import Swat from "../components/Swat";
import Hunza from "../components/Hunza";
import useFetch from "../hooks/useFetch";
import "../styles/ImageSlider.css";

function Destination(props) {
  const { name } = useParams();
  const { data,loading,error } = useFetch("hotels/countByArea?areas=skardu,Gilgit")
  console.log(data);

  switch (name) {
    case "Swat":
      return (<div><div className="left-column">
        <Swat />
        </div> 
        <div className="right-column"></div>
        </div>);
    case "Skardu":
      return (<div><div className="left-column">
      <Skardu />
      </div> 
      <div className="right-column"></div>
      </div>);
    case "Hunza":
      return (<div><div className="left-column">
      <Hunza />
      </div> 
      <div className="right-column"></div>
      </div>);
    default:
      return <div>Destination not found</div>;
  }
}

export default Destination;
